css:
@charset "UTF-8";
atom-text-editor,
:host {
  background-color: #292a44;
  color: #f1eff7;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #292a44;
  color: #f1eff7;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #383a62;
  color: #f1eff7;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f1eff7;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #333454;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #333454;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #333454;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #4ad481;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #f1eff7;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #94f2e7;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #383a62;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #333454;
}
atom-text-editor::shadow .bracket-matcher .region {
  z-index: 100;
  border-radius: 2px;
  background-color: rgba(109, 254, 223, 0.3);
  border: 1px solid rgba(109, 254, 223, 0.6);
}
.comment {
  color: #57578b;
}
.string {
  color: #6dfedf;
}
.constant.numeric {
  color: #ffdb7d;
}
.constant.language,
.constant.character,
.constant.other {
  color: #ae81ff;
}
.variable {
  color: #ff6f9f;
}
.keyword {
  color: #7aa5ff;
}
.storage {
  color: #ed4781;
}
.storage.type {
  color: #ed4781;
}
.entity.name.class {
  color: #678bdc;
}
.entity.other.inherited-class {
  color: #678bdc;
}
.entity.name.function {
  color: #2de0a7;
}
.variable.parameter {
  color: #ffbc69;
}
.entity.name.tag {
  color: #ff6f9f;
}
.entity.other.attribute-name {
  color: #f92672;
}
.support.function,
.support.constant {
  color: #66d9ef;
}
.support.type,
.support.class {
  color: #66d9ef;
}
.invalid,
.invalid.deprecated {
  font-style: italic;
  color: #e72d2d;
  border-bottom: 1px dotted #e72d2d;
}
.invalid.deprecated {
  color: #e88e2c;
  border-bottom-color: #e88e2c;
}
